--

CREATE TABLE IF NOT EXISTS `promotionals` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `branch_id` int(11) DEFAULT NULL,
  `description` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `date` date DEFAULT NULL,
  `code` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `start` date DEFAULT NULL,
  `end` date DEFAULT NULL,
  `cgroup_id` int(11) DEFAULT NULL,
  `customer_id` int(11) DEFAULT NULL,
  `note` text COLLATE utf8_unicode_ci,
  `type` tinyint(4) DEFAULT NULL COMMENT '1: Item; 2: Invoice',
  `approved` datetime DEFAULT NULL,
  `approved_by` int(11) DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `modified_by` int(11) DEFAULT NULL,
  `apply` tinyint(4) DEFAULT '1',
  `promotion_type` tinyint(12) DEFAULT '0' COMMENT '1:buy free the same/difference product,2:buy more than 100$ free one product,2:buy more than 100 get discount 3%,4:buy 5items ifference price get 3items with price 20$',
  `status` tinyint(4) DEFAULT '1' COMMENT '-1: Disapprove; 0: Void; 1: Request; 2: Approved',
  PRIMARY KEY (`id`),
  KEY `period` (`start`,`end`),
  KEY `status` (`status`),
  KEY `filters` (`date`,`cgroup_id`,`customer_id`),
  KEY `branch_id` (`branch_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=1 ;

